import React from 'react'
import Card from 'react-bootstrap/Card';
import { details1 } from './details';
import './Contact.css'
const Contact = () => {

    return (
        <div className='Staff'>
            <h4 style={{ textAlign: 'center' }}>Staff Coordinator</h4>
            {
                details1.map((detail, index) => {
                    return (
                        <div>
                            <Card bg='white' style={{ width: '18rem' }} className="mb-2">
                                <Card.Body>
                                    <Card.Title>Name: {detail.guide}</Card.Title>
                                    <Card.Text>
                                        <h5>Contact Details:</h5> <br></br>
                                        <span>{detail.Phno}</span>
                                    </Card.Text>
                                </Card.Body>
                            </Card>
                        </div >
                    )
                })
            }
        </div >

    )
}

export default Contact
